// import '../Form.css'
import Form from './Form';
// import { useEffect, useState } from 'react';

export default function LoginForm() {
  return (
    <Form
      title="С возвращением!"
      name="login"
      buttonText="Войти"
      // submitDisabled={submitDisabled}
      // onSubmit={handleSubmit}
    >
      {/* <label htmlFor="username" className='form__input-label'>Имя</label>
      <input
        className="form__input"
        placeholder="Введите имя"
        type="text"
        name="username"
        required
        minLength={2}
        maxLength={30}
      // onChange={handleNameChange}
      // value={name || ''}
      ></input>
      <p className='input__error'></p> */}
      
      <label htmlFor="email" className='form__input-label'>E-mail</label>
      <input
        className="form__input"
        placeholder="Введите e-mail"
        type="email"
        name="email"
        required
        minLength={2}
        maxLength={30}
      // onChange={handleEmailChange}
      // value={email || ''}
      ></input>
      
      <p className='input__error'></p>

      {/* <label htmlFor="phone" className='form__input-label'>Телефон</label>
      <input
        className="form__input"
        placeholder="Телефон"
        type="tel"
        name="phone"
        required
        minLength={10}
        maxLength={20}
        // pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
      // onChange={handleEmailChange}
      // value={'+7'}
      ></input>
      
      <p className='input__error'></p> */}

      <label htmlFor="password" className='form__input-label'>Пароль</label>
      <input
        className="form__input"
        placeholder="Введите пароль"
        type="password"
        name="password"
        required
        minLength={6}
        maxLength={30}
      // onChange={handlePasswordChange}
      // value={password || ''}
      ></input>

      <p className='input__error'></p>

      {/* <p className='input__error'>{inputError}</p> */}

    </Form>
  )
}
